import { FC, memo } from 'react';
import { getLastUpdated } from '../utils';
import { Card, Avatar } from 'antd';
const { Meta } = Card;

interface P {
  issues: any;
}

const Issues: FC<P> = memo(({ issues }) =>
  issues.map((item: any) => (
    <Card key={item.id}>
      <Meta
        avatar={<Avatar src={item.user.avatar_url} />}
        title={item.title}
        description={`Updated at ${getLastUpdated(item.updated_at)}`}
      ></Meta>
    </Card>
  ))
);

export default Issues;
